def new_approach_cf(genome, k, l, t):
    kmerdict = {}
    kmerFinal=[]
    debugdict = {}
    for i in range(len(genome)-k):
        kmer = genome[i:i+k]
        #print "adding",kmer,"@",i
        if i < l-k:
            try:
                kmerdict[kmer]+=1
                if kmerdict[kmer]>=t:
                    kmerFinal.append("".join(kmer))
            except KeyError:
                kmerdict[kmer]=1
            
        
        else:
            kmerMinus = genome[i-l+k:i-l+k+k]
            #print kmerMinus
            kmerdict[kmerMinus]-=1
            #print i, "removing",kmerMinus
            try:
                kmerdict[kmer]+=1
                if kmerdict[kmer]>=t:
                    #print kmer, kmerdict[kmer],">=",t
                    kmerFinal.append("".join(kmer))
            except KeyError:
                kmerdict[kmer]=1
    return " ".join(list(set(kmerFinal)))

